webpackJsonp([0xbcd69057f924],{1052:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2018-02-16-BYU-blockchain-summit-john-johnson/index.md absPath of file >>> MarkdownRemark",html:'<p>I got up at 5am this morning which is something I never do, but decided it would be worth the drive to Happy Valley to listen to local leaders in the Blockchain world.</p>\n<h2>Blockchain: What is it and what can it do?</h2>\n<h3><a href="https://www.linkedin.com/in/jonathanjohnson3/">Jonathan Johnson</a>, president of <a href="http://www.mediciventures.com/">Medici Ventures</a></h3>\n\n  <a class="gatsby-resp-image-link" href="/static/JonathanJohnson_BlockChainConference-4921fa9014c9b32f51e3122763779e0f-a37fb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="JonathanJohnson BlockChainConference" title="" src="/static/JonathanJohnson_BlockChainConference-4921fa9014c9b32f51e3122763779e0f-b80fa.jpg" srcset="/static/JonathanJohnson_BlockChainConference-4921fa9014c9b32f51e3122763779e0f-cf410.jpg 163w,\n/static/JonathanJohnson_BlockChainConference-4921fa9014c9b32f51e3122763779e0f-62f2a.jpg 325w,\n/static/JonathanJohnson_BlockChainConference-4921fa9014c9b32f51e3122763779e0f-b80fa.jpg 650w,\n/static/JonathanJohnson_BlockChainConference-4921fa9014c9b32f51e3122763779e0f-08cb4.jpg 975w,\n/static/JonathanJohnson_BlockChainConference-4921fa9014c9b32f51e3122763779e0f-f2bf9.jpg 1300w,\n/static/JonathanJohnson_BlockChainConference-4921fa9014c9b32f51e3122763779e0f-fd4ba.jpg 1950w,\n/static/JonathanJohnson_BlockChainConference-4921fa9014c9b32f51e3122763779e0f-a37fb.jpg 4032w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Fall of 2013 Johnson\'s son asked his dad when will Overstock.com start accepting Bitcoin? At the same Overstock\'s founder <a href="https://en.wikipedia.org/wiki/Patrick_M._Byrne">Patrick Byrne</a> and on Jan 9, 2014 became the first major retailer to accept Bitcoin.</p>\n<p>Blockchain will do for assets what the internet did for information. Where assets are stocks, titles, contracts or any kind of physical assets where you don\'t want a copy you want the original item.</p>\n<p>Blockchain is technology that let&apos;s us trust each other when we don&apos;t know each other - &quot;Trust through technology&quot;</p>\n\n  <a class="gatsby-resp-image-link" href="/static/TrustThroughTechnology-4740b4add267b9234777f41f20cdbf82-a37fb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="TrustThroughTechnology" title="" src="/static/TrustThroughTechnology-4740b4add267b9234777f41f20cdbf82-b80fa.jpg" srcset="/static/TrustThroughTechnology-4740b4add267b9234777f41f20cdbf82-cf410.jpg 163w,\n/static/TrustThroughTechnology-4740b4add267b9234777f41f20cdbf82-62f2a.jpg 325w,\n/static/TrustThroughTechnology-4740b4add267b9234777f41f20cdbf82-b80fa.jpg 650w,\n/static/TrustThroughTechnology-4740b4add267b9234777f41f20cdbf82-08cb4.jpg 975w,\n/static/TrustThroughTechnology-4740b4add267b9234777f41f20cdbf82-f2bf9.jpg 1300w,\n/static/TrustThroughTechnology-4740b4add267b9234777f41f20cdbf82-fd4ba.jpg 1950w,\n/static/TrustThroughTechnology-4740b4add267b9234777f41f20cdbf82-a37fb.jpg 4032w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Many people in the world don\'t have bank accounts which makes it difficule to participate in the modern economy. Efforts are focused on using Blockchain to improve the world through their investments.</p>\n<h4>Medici Ventures investments include:</h4>\n<ul>\n  <li>Democratize Capital</li>\n  <li>Money & Banking</li>\n  <li>Identity</li>\n  <li>Property & Land</li>\n  <li>Voting</li>\n  <li>Underlying Technology</li>\n</ul>\n<h4>Companies Medici Ventures has invested in:</h4>\n\n  <a class="gatsby-resp-image-link" href="/static/MediciVenturesCompanies-45bb258af42a36f26536585d04f1914a-a37fb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="MediciVenturesCompanies" title="" src="/static/MediciVenturesCompanies-45bb258af42a36f26536585d04f1914a-b80fa.jpg" srcset="/static/MediciVenturesCompanies-45bb258af42a36f26536585d04f1914a-cf410.jpg 163w,\n/static/MediciVenturesCompanies-45bb258af42a36f26536585d04f1914a-62f2a.jpg 325w,\n/static/MediciVenturesCompanies-45bb258af42a36f26536585d04f1914a-b80fa.jpg 650w,\n/static/MediciVenturesCompanies-45bb258af42a36f26536585d04f1914a-08cb4.jpg 975w,\n/static/MediciVenturesCompanies-45bb258af42a36f26536585d04f1914a-f2bf9.jpg 1300w,\n/static/MediciVenturesCompanies-45bb258af42a36f26536585d04f1914a-fd4ba.jpg 1950w,\n/static/MediciVenturesCompanies-45bb258af42a36f26536585d04f1914a-a37fb.jpg 4032w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<h4>Blockchain solutions to global poverty</h4>\n<p>&quot;It&apos;s expensive to be poor&quot; - Babriel Abed, Bitt Founder</p>\n<p>&quot;Any who&apos;s been to a payday lender would say it&apos;s expensive to be poor&quot; - John Johnson</p>\n\n  <a class="gatsby-resp-image-link" href="/static/its_expensive_to_be_poor-b6c6591a01fd5481b0d7fd9b0ee38f6e-a37fb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="its expensive to be poor" title="" src="/static/its_expensive_to_be_poor-b6c6591a01fd5481b0d7fd9b0ee38f6e-b80fa.jpg" srcset="/static/its_expensive_to_be_poor-b6c6591a01fd5481b0d7fd9b0ee38f6e-cf410.jpg 163w,\n/static/its_expensive_to_be_poor-b6c6591a01fd5481b0d7fd9b0ee38f6e-62f2a.jpg 325w,\n/static/its_expensive_to_be_poor-b6c6591a01fd5481b0d7fd9b0ee38f6e-b80fa.jpg 650w,\n/static/its_expensive_to_be_poor-b6c6591a01fd5481b0d7fd9b0ee38f6e-08cb4.jpg 975w,\n/static/its_expensive_to_be_poor-b6c6591a01fd5481b0d7fd9b0ee38f6e-f2bf9.jpg 1300w,\n/static/its_expensive_to_be_poor-b6c6591a01fd5481b0d7fd9b0ee38f6e-fd4ba.jpg 1950w,\n/static/its_expensive_to_be_poor-b6c6591a01fd5481b0d7fd9b0ee38f6e-a37fb.jpg 4032w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Bitt banking for the unbanked in the Carribean\nRipio 400k users in South America who can store their money without the worry of inflation\n\n  <a class="gatsby-resp-image-link" href="/static/bitt_ripio-730ae187875c07c252cfb63366c80cb8-a37fb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="bitt ripio" title="" src="/static/bitt_ripio-730ae187875c07c252cfb63366c80cb8-b80fa.jpg" srcset="/static/bitt_ripio-730ae187875c07c252cfb63366c80cb8-cf410.jpg 163w,\n/static/bitt_ripio-730ae187875c07c252cfb63366c80cb8-62f2a.jpg 325w,\n/static/bitt_ripio-730ae187875c07c252cfb63366c80cb8-b80fa.jpg 650w,\n/static/bitt_ripio-730ae187875c07c252cfb63366c80cb8-08cb4.jpg 975w,\n/static/bitt_ripio-730ae187875c07c252cfb63366c80cb8-f2bf9.jpg 1300w,\n/static/bitt_ripio-730ae187875c07c252cfb63366c80cb8-fd4ba.jpg 1950w,\n/static/bitt_ripio-730ae187875c07c252cfb63366c80cb8-a37fb.jpg 4032w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>2.5 billion globalized world citizens have access to offical ledgers. 5 billion of the world\'s un-globalized world citizens do not have access to a structured knowledge of property rights. That makes it difficult for those individuals to unlock they capital associated with that property for entreprenuership.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/5billion_do_own_assets-77e6b9725d6c166a2bb5c4dfdacb9c3e-a37fb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="5billion do own assets" title="" src="/static/5billion_do_own_assets-77e6b9725d6c166a2bb5c4dfdacb9c3e-b80fa.jpg" srcset="/static/5billion_do_own_assets-77e6b9725d6c166a2bb5c4dfdacb9c3e-cf410.jpg 163w,\n/static/5billion_do_own_assets-77e6b9725d6c166a2bb5c4dfdacb9c3e-62f2a.jpg 325w,\n/static/5billion_do_own_assets-77e6b9725d6c166a2bb5c4dfdacb9c3e-b80fa.jpg 650w,\n/static/5billion_do_own_assets-77e6b9725d6c166a2bb5c4dfdacb9c3e-08cb4.jpg 975w,\n/static/5billion_do_own_assets-77e6b9725d6c166a2bb5c4dfdacb9c3e-f2bf9.jpg 1300w,\n/static/5billion_do_own_assets-77e6b9725d6c166a2bb5c4dfdacb9c3e-fd4ba.jpg 1950w,\n/static/5billion_do_own_assets-77e6b9725d6c166a2bb5c4dfdacb9c3e-a37fb.jpg 4032w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<h4>What kinds of companies does Medici Ventures invest in?</h4>\n<ul>\n  <li>Great technology</li>\n  <li>Great sales</li>\n  <li>Domain knowledge</li>\n</ul>',frontmatter:{title:"BYU Blockchain Summit - John Johnson",date:"February 16, 2018",imageUrl:null,image:{childImageSharp:{sizes:{src:"/static/JonathanJohnson_BlockChainConference-4921fa9014c9b32f51e3122763779e0f-381d6.jpg"}}}}}},pathContext:{path:"/byu-blockchain-summit-jonathan-johnson"}}}});
